import React from "react";
import "./styles/landing.css"
import { motion } from "framer-motion";

const Section = ({id, title, content, buttonMsg, buttonLink}) => {
    return (
        <div className='container'>
            <section id={id}>
                <h2>{title}</h2>
                <p>{content}</p>
                {buttonMsg?.length > 0 &&(
                    <button><a href={buttonLink}>{buttonMsg}</a></button>
                )}
            </section>
        </div>
    );
};

const Landing = () => {

    return (
        <div className="container">
            <div className="section">
                <Section id="home" title="Home" content="HOME"/>
            </div>
            <div className="section">
                <Section id="for-business" 
                     title="For Businesses" 
                     content="Try OneReturn for business" 
                     buttonMsg="Try Onereturn for business here." 
                     buttonLink='https://console.onereturn.com/signin'/>
            </div>
            <div className="section">
                <Section id="pricing" title="Pricing" content="PRICING"/>
            </div>
        </div>



    )
}

export default Landing;
